'use strict';
//@@DocBrief("The class provides access to pDas trading session options")
class PdasSessionOptions {
    map;
    getOption(key) {
        if (this.map.contains(key)) {
            return this.map.get(key).get();
        }
        return null;
    }
    static create(map) {
        let instance;
        instance = new PdasSessionOptions();
        instance.map = map;
        return instance;
    }
}
module.exports = PdasSessionOptions
